import React from 'react';

import styles from './../Style/Components/Server.module.css';

type MyProps = { Name: string, id: number };
type MyState = { Picture: string, isToggleOn: boolean };

class Server extends React.Component<MyProps, MyState> {
  constructor(props) {
    super(props);
    console.log(props);
    this.state = {
      Picture: `${process.env.Storage_Url}/Servers/UUw40MdRDcUxdEy00Zuo/Icon`,
      isToggleOn: true
    };

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState(state => ({
      isToggleOn: !state.isToggleOn
    }));

  }
  render() {
    return (
      <button className={styles.Container} onClick={this.handleClick}>
        {this.state.isToggleOn ? 'ON' : 'OFF'}
        <picture>
          <img src={this.state.Picture} />
        </picture>
      </button>
    );
  }
}

export default Server;
